"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H24722758\">",
"      <span class=\"h1\">",
"       What is pelvic organ prolapse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pelvic organ prolapse is a condition that only affects women. It happens when tissues that support the organs in the lower belly relax. As a result, the organs drop down and press against or bulge into the vagina.",
"     </p>",
"     <p>",
"      If the bladder bulges into the vagina, doctors call this problem &ldquo;cystocele.&rdquo; If the rectum bulges into the vagina, they call it &ldquo;rectocele.&rdquo; Uterine prolapse means the uterus has bulged into the vagina (",
"      <a class=\"graphic graphic_figure graphicRef53393 \" href=\"mobipreview.htm?37/4/37957\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24722773\">",
"      <span class=\"h1\">",
"       What are the symptoms of pelvic organ prolapse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many women with this problem have no symptoms. But some women with pelvic organ prolapse have symptoms that include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fullness or pressure in the pelvis or vagina",
"       </li>",
"       <li>",
"        A bulge in the vagina or coming out of the vagina",
"       </li>",
"       <li>",
"        Leaking urine when they laugh, cough, or sneeze",
"       </li>",
"       <li>",
"        Needing to urinate all of a sudden",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      When they use the toilet, some women need to press on the bulge in the vagina with a finger to get out all their urine or to finish a bowel movement.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24722788\">",
"      <span class=\"h1\">",
"       Is there a test for pelvic organ prolapse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will be able to tell if you have it by doing a pelvic exam. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24722803\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Some women feel better if they do pelvic muscle exercises. These exercises strengthen the muscles that control the flow of urine and bowel movements. They are also known as &ldquo;Kegel&rdquo; exercises. Your nurse or doctor can teach you how to do them.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24722818\">",
"      <span class=\"h1\">",
"       How is pelvic organ prolapse treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Women who have no symptoms or who are not bothered by their symptoms do not need treatment. For women with symptoms that bother them, doctors suggest different treatments, including:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A vaginal pessary &ndash; This device fits inside a woman&rsquo;s vagina to support the bladder and push it back into place. Pessaries come in different shapes and sizes.",
"       </li>",
"       <li>",
"        Surgery &ndash; A surgeon can move dropped organs back where they belong and strengthen the tissues that keep them in place. Women should have this type of surgery only if they are done having children.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24722833\">",
"      <span class=\"h1\">",
"       Can pelvic organ prolapse be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can reduce your chances of pelvic organ prolapse if you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Lose weight if you are overweight",
"       </li>",
"       <li>",
"        Get treated for constipation if you are constipated",
"       </li>",
"       <li>",
"        Avoid activities that require you to lift heavy things",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24722848\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
