" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Superficial basal cell carcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This erythematous, slightly scaly patch is representative of a superficial basal cell carcinoma.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: www.visualdx.com. Copyright Logical Images, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Superficial basal cell carcinoma: solitary lesion",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 425px; height: 240px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This bright red lesion has a slightly elevated rolled border that can be detected with \"side lighting\". Although this lesion is typical enough to be diagnosed clinically, a biopsy is necessary to confirm the diagnosis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Fitzpatrick, TB, Johnson, RA, Wolff, K, Suurmond, D. Color Atlas &amp;Synopsis of Clinical Dermatology. Common &amp;Serious Diseases. (4th Ed). McGraw-Hill, New York 2001. Copyright &copy; 2001 McGraw- Hill.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Nodular basal cell carcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This pearly papule with telangiectasias is representative of a nodular basal cell carcinoma.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: www.visualdx.com. Copyright Logical Images, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Infiltrative basal cell carcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Infiltrative or morpheaform basal cell carcinomas can present as indented, scar-like lesions.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: www.visualdx.com. Copyright Logical Images, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Destructive basal cell carcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Large basal cell carcinoma causing destruction of the nose.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: www.visualdx.com. Copyright Logical Images, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
