"    Destructive basal cell carcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 324px; height: 432px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Large basal cell carcinoma causing destruction of the ear.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
