var title_f42_62_44011="Comparison MHC class I and II";
var content_f42_62_44011=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F70970&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F70970&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Table showing molecular comparison of MHC class I and class II molecules",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"20%\">",
"     </colgroup>",
"     <colgroup span=\"2\" width=\"40%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Class I MHC",
"       </td>",
"       <td class=\"subtitle1\">",
"        Class II MHC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Structure",
"        </strong>",
"       </td>",
"       <td>",
"        MHC encoded chain, beta-2 microglobulin",
"       </td>",
"       <td>",
"        MHC encoded chain, MHC encoded beta-chain",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Antigen binding groove",
"        </strong>",
"        *",
"       </td>",
"       <td>",
"        Closed",
"       </td>",
"       <td>",
"        Open",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Peptide length",
"        </strong>",
"       </td>",
"       <td>",
"        9 to 10 amino acids",
"       </td>",
"       <td>",
"        12 to 28 amino acids",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Source of antigen",
"        </strong>",
"       </td>",
"       <td>",
"        Intracellular",
"       </td>",
"       <td>",
"        Extracellular",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Expression",
"        </strong>",
"       </td>",
"       <td>",
"        All nucleated cells",
"       </td>",
"       <td>",
"        B cells, macrophages, dendritic cells",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Antigen presented to:",
"        </strong>",
"       </td>",
"       <td>",
"        CD8+ T cells",
"       </td>",
"       <td>",
"        CD4+ T cells",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The length of peptide and the conformation of the antigen binding groove differs between class I and II molecules. In the class I MHC molecule, the distal ends of the -helical regions meet and so the antigen binding cleft is completely enclosed apart from the uppermost surface. In contrast, the -helical regions of the class II MHC molecule do not meet. Thus, the molecule is able to present a longer peptide.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
